如果我们只想支持所有在选择中引用的列也存在于映射中的用例，我们可以通过一些非常简单的逻辑来构建查询计划。 fun createDataFrame(select: SqlSelect, tables: Map<String, DataFrame>) : DataFrame { // get a reference to the data source var df = tables[select.tableName] ?: throw SQLException("No table named '${select.tableName}'") val projectionExpr = select.projection.map { createLogicalExpr(it, df) } if (select.selection == null) { // apply projection return df.select(projectionExpr) } // apply projection then wrap in a selection (filter) return df.select(projectionExpr) .filter(createLogicalExpr(select.selection, df))
} 然而，由于选择可能同时引用映射的输入和输出，因此我们需要创建一个更复杂的带有中间投影的计划。第一步是确定哪些列被选择过滤表达式引用。为此，我们将使用访问者模式来遍历表达式树并构建一个可变的列名称集合。 以下是我们将用来遍历表达式树的实用方法。 private fun visit(expr: LogicalExpr, accumulator: MutableSet<String>) { when (expr) { is Column -> accumulator.add(expr.name) is Alias -> visit(expr.expr, accumulator) is BinaryExpr -> { visit(expr.l, accumulator) visit(expr.r, accumulator) } }
} 有了这个，我们现在可以编写以下代码将 SELECT 语句转换为有效的逻辑计划。此代码示例并不完美，可能包含一些边缘情况的错误，其中数据源中的列和别名表达式之间存在名称冲突，但是为了保持代码简洁暂时忽略它们。 fun createDataFrame(select: SqlSelect, tables: Map<String, DataFrame>) : DataFrame { // get a reference to the data source var df = tables[select.tableName] ?: throw SQLException("No table named '${select.tableName}'") // create the logical expressions for the projection val projectionExpr = select.projection.map { createLogicalExpr(it, df) } if (select.selection == null) { // if there is no selection then we can just return the projection return df.select(projectionExpr) } // create the logical expression to represent the selection val filterExpr = createLogicalExpr(select.selection, df) // get a list of columns references in the projection expression val columnsInProjection = projectionExpr .map { it.toField(df.logicalPlan()).name} .toSet() // get a list of columns referenced in the selection expression val columnNames = mutableSetOf<String>() visit(filterExpr, columnNames) // determine if the selection references any columns not in the projection val missing = columnNames - columnsInProjection // if the selection only references outputs from the projection we can // simply apply the filter expression to the DataFrame representing // the projection if (missing.size == 0) { return df.select(projectionExpr) .filter(filterExpr) } // because the selection references some columns that are not in the // projection output we need to create an interim projection that has // the additional columns and then we need to remove them after the // selection has been applied return df.select(projectionExpr + missing.map { Column(it) }) .filter(filterExpr) .select(projectionExpr.map { Column(it.toField(df.logicalPlan()).name) })
}

