第一步最好是为各个运算符和表达式编写单元测试，确保它们在给定输入下产生正确的输出。同时也要覆盖错误情况。 以下是编写单元测试时需要考虑的一些建议： 如果使用了意外的数据类型会发生什么？例如，在字符串输入上计算 SUM。 测试应涵盖边缘情况，例如对数值类型使用最小值和最大值，以及浮点类型中的 NaN（非数字），以确保它们被正确处理。 应该对下溢和上溢情况进行测试。例如，当两个长（64 位）整数类型相乘时会发生什么？ 测试还应确保正确处理空值。 在编写这些测试时，能够构建具有任意数据的记录批次和列向量以用作运算符和表达式的输入非常重要。以下是此类实用方法的一个示例。 private fun createRecordBatch(schema: Schema, columns: List<List<Any?>>): RecordBatch { val rowCount = columns[0].size val root = VectorSchemaRoot.create(schema.toArrow(), RootAllocator(Long.MAX_VALUE)) root.allocateNew() (0 until rowCount).forEach { row -> (0 until columns.size).forEach { col -> val v = root.getVector(col) val value = columns[col][row] when (v) { is Float4Vector -> v.set(row, value as Float) is Float8Vector -> v.set(row, value as Double) ... } } } root.rowCount = rowCount return RecordBatch(schema, root.fieldVectors.map { ArrowFieldVector(it) })
} 以下是一个针对包含两个双精度浮点值列的记录批进行“大于或等于”（>=）表达式的示例单元测试。 @Test
fun `gteq doubles`() { val schema = Schema(listOf( Field("a", ArrowTypes.DoubleType), Field("b", ArrowTypes.DoubleType) )) val a: List<Double> = listOf(0.0, 1.0, Double.MIN_VALUE, Double.MAX_VALUE, Double.NaN) val b = a.reversed() val batch = createRecordBatch(schema, listOf(a,b)) val expr = GtEqExpression(ColumnExpression(0), ColumnExpression(1)) val result = expr.evaluate(batch) assertEquals(a.size, result.size()) (0 until result.size()).forEach { assertEquals(if (a[it] >= b[it]) 1 else 0, result.getValue(it)) }
}

