我们将使用 Apache Arrow 作为我们类型系统的基础。以下 Arrow 类用于表示结构、字段和数据类型。 Schema 为数据源或查询结果提供元数据，结构由一个或多个字段组成。 Field 为结构中字段的名称和数据类型，并指定它是否允许空值。 FieldVector 为字段数据提供列式存储。 ArrowType 表示一种数据类型。 KQuery 引入了一些额外的类和助手作为对 Apache Arrow 类型系统的抽象。 KQuery 为受支持的 Arrow 数据类型提供了可引用的常量。 object ArrowTypes { val BooleanType = ArrowType.Bool() val Int8Type = ArrowType.Int(8, true) val Int16Type = ArrowType.Int(16, true) val Int32Type = ArrowType.Int(32, true) val Int64Type = ArrowType.Int(64, true) val UInt8Type = ArrowType.Int(8, false) val UInt16Type = ArrowType.Int(16, false) val UInt32Type = ArrowType.Int(32, false) val UInt64Type = ArrowType.Int(64, false) val FloatType = ArrowType.FloatingPoint(FloatingPointPrecision.SINGLE) val DoubleType = ArrowType.FloatingPoint(FloatingPointPrecision.DOUBLE) val StringType = ArrowType.Utf8()
} KQuery 并没有直接使用 FieldVector，而是引入了一个 ColumnVector 接口作为抽象，以提供更方便的访问方法，从而避免了为每种数据类型都使用特定的 FieldVector 实现。 interface ColumnVector { fun getType(): ArrowType fun getValue(i: Int) : Any? fun size(): Int
} 这种抽象也使得标量值的实现成为可能，从而避免了用字面量为列中每个索引重复创建和填入 FieldVector。 class LiteralValueVector( val arrowType: ArrowType, val value: Any?, val size: Int) : ColumnVector { override fun getType(): ArrowType { return arrowType } override fun getValue(i: Int): Any? { if (i<0 || i>=size) { throw IndexOutOfBoundsException() } return value } override fun size(): Int { return size } } KQuery 还提供了一个 RecordBatch 类来表示一批列式数据。 class RecordBatch(val schema: Schema, val fields: List<ColumnVector>) { fun rowCount() = fields.first().size() fun columnCount() = fields.size /** Access one column by index */ fun field(i: Int): ColumnVector { return fields[i] } } 这本书还可通过 https://leanpub.com/how-query-engines-work 购买 ePub、MOBI 和 PDF格式版本。 Copyright © 2020-2023 Andy Grove. All rights reserved.

