映射下推规则的目标是在从磁盘读取数据之后和查询执行的其他阶段之前尽快过滤掉列，以减少运算符之间保留在内存中（以及在分布式场景下可能通过网络传输）的数据量。 为了知道查询中引用了哪些列，我们必须编写递归代码来检查表达式并构建列列表。 fun extractColumns(expr: List<LogicalExpr>, input: LogicalPlan, accum: MutableSet<String>) { expr.forEach { extractColumns(it, input, accum) }
} fun extractColumns(expr: LogicalExpr, input: LogicalPlan, accum: MutableSet<String>) { when (expr) { is ColumnIndex -> accum.add(input.schema().fields[expr.i].name) is Column -> accum.add(expr.name) is BinaryExpr -> { extractColumns(expr.l, input, accum) extractColumns(expr.r, input, accum) } is Alias -> extractColumns(expr.expr, input, accum) is CastExpr -> extractColumns(expr.expr, input, accum) is LiteralString -> {} is LiteralLong -> {} is LiteralDouble -> {} else -> throw IllegalStateException( "extractColumns does not support expression: $expr") }
} 有了这个实用的代码，我们就可以继续实施优化器规则。请注意，对于 Projection、Selection 和 Aggregate 计划，我们正在构建列名列表，但当我们到达 Scan（它是一个叶节点）时，我们将其替换为在查询中其他地方使用的列名列表的扫描版本。 class ProjectionPushDownRule : OptimizerRule { override fun optimize(plan: LogicalPlan): LogicalPlan { return pushDown(plan, mutableSetOf()) } private fun pushDown(plan: LogicalPlan, columnNames: MutableSet<String>): LogicalPlan { return when (plan) { is Projection -> { extractColumns(plan.expr, columnNames) val input = pushDown(plan.input, columnNames) Projection(input, plan.expr) } is Selection -> { extractColumns(plan.expr, columnNames) val input = pushDown(plan.input, columnNames) Selection(input, plan.expr) } is Aggregate -> { extractColumns(plan.groupExpr, columnNames) extractColumns(plan.aggregateExpr.map { it.inputExpr() }, columnNames) val input = pushDown(plan.input, columnNames) Aggregate(input, plan.groupExpr, plan.aggregateExpr) } is Scan -> Scan(plan.name, plan.dataSource, columnNames.toList().sorted()) else -> throw new UnsupportedOperationException() } } } 给定这个输入逻辑计划： Projection: #id, #first_name, #last_name Filter: #state = 'CO' Scan: employee; projection=None 该优化器规则会将其转换为以下计划。 Projection: #id, #first_name, #last_name Filter: #state = 'CO' Scan: employee; projection=[first_name, id, last_name, state]

