我们将根据 Vaughan R. Pratt 于 1973 年发表的 Top Down Operator Precedence 论文手动编写 SQL 解析器。尽管还有其他方法来构建 SQL 解析器，例如使用解析器生成器和解析器组合器，但我发现了 Pratt 的方法工作良好，代码高效、易于理解且易于调试。 这是 Pratt 解析器的简单实现。在我看来，它的美丽在于它的简单。表达式解析是通过一个简单的循环来执行的，该循环解析“前缀”表达式，后跟一个可选的“中缀”表达式，并继续执行此操作，直到优先级发生变化，使解析器认识到它已完成对表达式的解析。当然，parsePrefix 和 parseInfix 的实现可以递归地回调 parse 方法，这就是它变得非常强大的地方。 interface PrattParser { /** Parse an expression */ fun parse(precedence: Int = 0): SqlExpr? { var expr = parsePrefix() ?: return null while (precedence < nextPrecedence()) { expr = parseInfix(expr, nextPrecedence()) } return expr } /** Get the precedence of the next token */ fun nextPrecedence(): Int /** Parse the next prefix expression */ fun parsePrefix(): SqlExpr? /** Parse the next infix expression */ fun parseInfix(left: SqlExpr, precedence: Int): SqlExpr } 该接口引用一个新 SqlExpr 类，它将作为解析表达式的表示，并且很大程度上会与逻辑计划中定义的表达式一一对应，但对于二元表达式，我们可以使用更通用的结构，其中运算符是字符串而不是为所有不同二元表达式创建单独数据结构。 以下是一些实现 SqlExpr 的例子。 /** SQL Expression */
interface SqlExpr /** Simple SQL identifier such as a table or column name */
data class SqlIdentifier(val id: String) : SqlExpr { override fun toString() = id
} /** Binary expression */
data class SqlBinaryExpr(val l: SqlExpr, val op: String, val r: SqlExpr) : SqlExpr { override fun toString(): String = "$l $op $r"
} /** SQL literal string */
data class SqlString(val value: String) : SqlExpr { override fun toString() = "'$value'"
} 有了这些类后，就可以用下面代码表示 foo = 'bar'。 val sqlExpr = SqlBinaryExpr(SqlIdentifier("foo"), "=", SqlString("bar"))

