让我们通过解析一个简单的数学表达式 1 + 2 * 3 来逐步了解这种方法，该表达式由以下标记组成。 listOf( LiteralLongToken("1"), OperatorToken("+"), LiteralLongToken("2"), OperatorToken("*"), LiteralLongToken("3")
) 我们需要创建一个实现了 PrattParser 特性（trait） 的对象，并将标记（tokens）传入构造函数。这些标记（tokens）被包装在一个 TokenStream 类中，该类提供了一些方便的方法，例如next 用于消耗下一个标记（tokens），以及 peek 当我们想要向前查看而不消耗标记（token）时。 class SqlParser(val tokens: TokenStream) : PrattParser {
} 实现 nextPrecedence 方法很简单，因为我们只有少量具有优先级的标记（token），我们需要让乘法 和 除法 运算符具有比 加法 和 减法 运算符更高的优先级。请注意，此方法返回的具体数字并不重要，因为它们仅用于比较。关于运算符优先级的一个很好的参考可以在 PostgreSQL documentation 中找到。 override fun nextPrecedence(): Int { val token = tokens.peek() return when (token) { is OperatorToken -> { when (token.s) { "+", "-" -> 50 "*", "/" -> 60 else -> 0 } } else -> 0 }
} 前缀解析器只需要知道如何解析字面数值。 override fun parsePrefix(): SqlExpr? { val token = tokens.next() ?: return null return when (token) { is LiteralLongToken -> SqlLong(token.s.toLong()) else -> throw IllegalStateException("Unexpected token $token") }
} 中缀解析器只需要知道如何解析运算符。请注意，解析运算符后，此方法会递归回调上层的 parse 方法来解析运算符后面的表达式（二元表达式的右侧）。 override fun parseInfix(left: SqlExpr, precedence: Int): SqlExpr { val token = tokens.peek() return when (token) { is OperatorToken -> { tokens.next() SqlBinaryExpr(left, token.s, parse(precedence) ?: throw SQLException("Error parsing infix")) } else -> throw IllegalStateException("Unexpected infix token $token") }
} 优先级逻辑可以通过解析数学表达式 1 + 2 * 3 和 1 * 2 + 3 来演示，它们应该被分别解析为 1 + (2 * 3) 和 (1 * 2) + 3。 示例: 解析 1 + 2 _ 3 这些是标记及其优先级值。 Tokens: [1] [+] [2] [*] [3]
Precedence: [0] [50] [0] [60] [0] 最终结果正确地将表达式表示为 1 + (2 * 3)。 SqlBinaryExpr( SqlLong(1), "+", SqlBinaryExpr(SqlLong(2), "*", SqlLong(3))
) 示例: 解析 1 _ 2 + 3 Tokens: [1] [*] [2] [+] [3]
Precedence: [0] [60] [0] [50] [0] 最终结果正确地将表达式表示为 (1 * 2) + 3。 SqlBinaryExpr( SqlBinaryExpr(SqlLong(1), "*", SqlLong(2)), "+", SqlLong(3)
)
